textOriginal:
Eu quero voltar a usar uma roupa vermelha sem sentir sobre mim olhares agressivos;
eu quero voltar a ver a bandeira brasileira como um símbolo do meu País e não de arruaceiros;
eu quero voltar a ser respeitada no mundo como brasileira e jamais vista como débil mental;
porque a partir do momento em que sinto medo de sair de casa, com medo de ser agredida, é porque estou vivendo em um governo nazista.
Quero voltar a acreditar no art. 5º da nossa Constituição; que volte a valer para que eu seja feliz, livre do pesadelo que nos acomete desde 2019.
GRAÇAS A DEUS, VENCEMOS!!!!!
